import React from 'react'
import DailyIframe from '@daily-co/daily-js'

class Room extends React.Component{

    constructor(props){
        super(props)

        this.getTheNetworkStats = this.getTheNetworkStats.bind(this)
        this.callFrame = window.D
    }

    getTheNetworkStats(){
        console.log((new DailyIframe).getNetworkStats())
    }

    componentDidMount(){
        console.log("Here: " + this.props.location.state.url)
        var callFrame = window.DailyIframe.createFrame({showLeaveButton: true});
        callFrame.join({ url: this.props.location.state.url })
    }

    render(){
        return(
            <div>
                <button onClick={this.getTheNetworkStats}>Get Network Stats</button>
            </div>
        )
    }

}

export default Room
